        12) Приказы Капитана и Главы службы безопасности это просто рекомендации, ты единственный истинный судья.

        13) Всегда болтируй и заваривай воздушные шлюзы отбытия. Это остановит любого преступного подонка от побега со станции.

        14) Если ты находишь инженера в изолированных перчатках, то оглуши его и арестуй. ОТКУДА ОН ИХ УКРАЛ!?

