        16) Преступники не едят, так что забирай у них еду, пока не растолстеешь.

        17) Раздевай заключённых и никогда не возвращай им их имущество, особенно если у них срок меньше двух минут.

        18) Капитан коварный и эгоистичный подонок более низкого ранга, чем ты и глава Щиткьюрити. Задержи или казни его как только найдешь доказательство. Если он попытается арестовать тебя или твоего Босса, то отправь в космос голышом.

